import {Nav,Navbar,} from 'react-bootstrap'

class NavBar extends Component {
    state = {  }
    render() { 
          return(
            <nav className="navbar navbar-light bg-light">
            <div className="container-fluid">
            <NavLink className="nav-item nav-link" to="/home" >Vidly</NavLink>
            <NavLink className="nav-item nav-link" to="/Customer" >people</NavLink>
            <NavLink className="nav-item nav-link" to="/movies" >Movies</NavLink>
            <NavLink className="nav-item nav-link" to="/posts" >Posts</NavLink>
            <NavLink className="nav-item nav-link" to="/login" >Login</NavLink>
            <NavLink className="nav-item nav-link" to="/regist" >regist</NavLink>

            </div>
        </nav>   
                      );
    }
}

export default NavBar;
